function App() {
  return (
    <div className="App">
      <Header></Header>
      <Router>
        <Route exact path="/" component={Home}></Route>
        <Route path="/faq" component={Faq}></Route>
      </Router>
      {/* <Switch>
        <Route exact path="/" component={Home}></Route>
        <Route path="/faq" component={Faq}></Route>
      </Switch> */}

      <Footer></Footer>
    </div>
  );
}

export default App;
